import { Link } from 'react-router-dom';

export const Navbar = () =>{
    return <div className="navbar">
        <Link to="/">Home</Link>
        <Link to="/auth">Login/Register</Link>
        <Link to="/create-memory">Create Memory</Link>
        <Link to="/saved-memories">Saved Memories</Link>
    </div>
}
